import logo from './logo.svg';
import './App.css';
import "./assets/style/normalize.css"

import { Switch, Route} from 'react-router';

import Home from "./containers/home"
function App() {
  return (
    <div className="App">
      <Switch>
        <Route exact path="/" component={Home}/>
      </Switch>
    </div>
  );
}

export default App;
